import React from 'react';

import NumberDisplay from "./numberdisplay"
import "./tridata.css"

class Tridata extends React.Component {
    constructor (props) {
        super(props);

        this.state = {
            "depth.belowTransducer": 2.7,
            "navigation.speedOverGround": 5.2,
            "performance.velocityMadeGood": 3.0
        }

        this.onMessage = (message) => {
            console.log("Tridata here");
            console.log(message.values[0].path)
        }

        this.props.subscribe(["depth.belowTransducer", "navigation.speedOverGround", "performance.velocityMadeGood"], this.onMessage)
    }

    render () {
        return <div className="container" style={{ width: this.props.width + "px", height: this.props.height + "px" }}>
            <NumberDisplay
                value={this.state["depth.belowTransducer"]}
                suffix=""
                unit="m"
                width={this.props.width}
                height={this.props.height / 3}
                upperBound={99}
                decimalPlaces={1}
                fontSize={this.props.width / 4}
            />
            <NumberDisplay
                value={this.state["navigation.speedOverGround"]}
                suffix=""
                unit="m/s"
                width={this.props.width}
                height={this.props.height / 3}
                upperBound={99}
                decimalPlaces={2}
                fontSize={this.props.width / 4}
            />
            <NumberDisplay
                value={this.state["performance.velocityMadeGood"]}
                suffix=""
                unit="m/s"
                width={this.props.width}
                height={this.props.height / 3}
                upperBound={99}
                decimalPlaces={1}
                fontSize={this.props.width / 4}
            />
        </div>
    }
}

export default Tridata;
